import React from "react";
import { StyleSheet, Text, SafeAreaView } from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import Ionicons from 'react-native-vector-icons/Ionicons'; // icons til senere

// screenz
import MapScreen from "../app/screens/MapScreen"; // Importer din MapScreen her
import TableScreen from "../app/screens/TableScreen"; // Importer din TableScreen her
import CreateEventScreen from "../app/screens/CreateEventScreen"; // Importer din CreateEventScreen her
import FriendsScreen from "../app/screens/FriendsScreen"; // Importer din FriendsScreen her
import NearMeScreen from "../app/screens/NearMeScreen"; // Importer din NearMeScreen her
import NewEventsScreen from "../app/screens/NewEventsScreen"; // Importer din NearMeScreen her

const Tab = createBottomTabNavigator();

const Navigator = () => {
  return (
    <NavigationContainer>
      <Tab.Navigator
        screenOptions={({ route }) => ({
          tabBarIcon: ({ focused, color, size }) => {
            let iconName;

            if (route.name === 'Map') {
              iconName = focused ? 'map' : 'map-outline';
            } else if (route.name === 'Events') {
              iconName = focused ? 'calendar' : 'calendar-outline';
            } else if (route.name === 'Opret event') {
              iconName = focused ? 'add-circle' : 'add-circle-outline';
            } else if (route.name === 'venner') {
              iconName = focused ? 'people' : 'people-outline';
            } else if (route.name === 'Nær mig') {
              iconName = focused ? 'location' : 'location-outline';
            }

            // return component
            return <Ionicons name={iconName} size={size} color={color} />;
          },
        })}
        tabBarOptions={{
          activeTintColor: 'tomato', //blue
          inactiveTintColor: 'gray', // black
        }}
      >
        <Tab.Screen name="Map" component={MapScreen} />
        <Tab.Screen name="Events" component={TableScreen} />
        <Tab.Screen name="Opret event" component={CreateEventScreen} />
        <Tab.Screen name="venner" component={FriendsScreen} />
        <Tab.Screen name="Nær mig" component={NearMeScreen} />
        <Tab.Screen name="New Events" component={NewEventsScreen} />
      </Tab.Navigator>
    </NavigationContainer>
  );
};

export default Navigator;
